pragma solidity ^0.5.0;

/**
 * @dev Wrappers over Solidity's arithmetic operations with added overflow
 * checks.
 *
 * Arithmetic operations in Solidity wrap on overflow. This can easily result
 * in bugs, because programmers usually assume that an overflow raises an
 * error, which is the standard behavior in high level programming languages.
 * `SafeMath` restores this intuition by reverting the transaction when an
 * operation overflows.
 *
 * Using this library instead of the unchecked operations eliminates an entire
 * class of bugs, so it's recommended to use it always.
 */
library SafeMath {event __CoverageSafeMath(string fileName, uint256 lineNumber);
event __FunctionCoverageSafeMath(string fileName, uint256 fnId);
event __StatementCoverageSafeMath(string fileName, uint256 statementId);
event __BranchCoverageSafeMath(string fileName, uint256 branchId, uint256 locationIdx);
event __AssertPreCoverageSafeMath(string fileName, uint256 branchId);
event __AssertPostCoverageSafeMath(string fileName, uint256 branchId);

    /**
     * @dev Returns the addition of two unsigned integers, reverting on
     * overflow.
     *
     * Counterpart to Solidity's `+` operator.
     *
     * Requirements:
     * - Addition cannot overflow.
     */
    function add(uint256 a, uint256 b) internal      returns (uint256) {emit __FunctionCoverageSafeMath('/Volumes/Data/Projects/Unlock-dApp/contracts/SafeMath.sol',1);

emit __CoverageSafeMath('/Volumes/Data/Projects/Unlock-dApp/contracts/SafeMath.sol',27);
        emit __StatementCoverageSafeMath('/Volumes/Data/Projects/Unlock-dApp/contracts/SafeMath.sol',1);
uint256 c = a + b;
emit __CoverageSafeMath('/Volumes/Data/Projects/Unlock-dApp/contracts/SafeMath.sol',28);
        emit __AssertPreCoverageSafeMath('/Volumes/Data/Projects/Unlock-dApp/contracts/SafeMath.sol',1);
emit __StatementCoverageSafeMath('/Volumes/Data/Projects/Unlock-dApp/contracts/SafeMath.sol',2);
require(c >= a, "SafeMath: addition overflow");emit __AssertPostCoverageSafeMath('/Volumes/Data/Projects/Unlock-dApp/contracts/SafeMath.sol',1);


emit __CoverageSafeMath('/Volumes/Data/Projects/Unlock-dApp/contracts/SafeMath.sol',30);
        emit __StatementCoverageSafeMath('/Volumes/Data/Projects/Unlock-dApp/contracts/SafeMath.sol',3);
return c;
    }
}
